import React, { useEffect, useState } from 'react';
import './PaginaInicial.css';
import { useNavigate } from 'react-router-dom';

function PaginaInicial() {
  const [livros, setLivros] = useState([]);
  const [termoBusca, setTermoBusca] = useState('');
  const [filtros, setFiltros] = useState([]);
  const [filtroSelecionado, setFiltroSelecionado] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetch('http://localhost:5000/filtros')
      .then(res => res.json())
      .then(data => setFiltros(data))
      .catch(err => console.error('Erro ao buscar filtros:', err));

    fetch('http://localhost:5000/livros')
      .then(res => res.json())
      .then(data => setLivros(data))
      .catch(err => console.error('Erro ao buscar livros:', err));
  }, []);

  const livrosFiltrados = livros.filter(livro => {
    const nomeCoincide = livro.nome.toLowerCase().includes(termoBusca.toLowerCase());
    const filtroCoincide = filtroSelecionado === '' || livro.filtro?.id === parseInt(filtroSelecionado);
    return nomeCoincide && filtroCoincide;
  });

  function abrirDetalhes(id) {
    navigate(`/livros/${id}`);
  }

  function adicionarAoCarrinho(e, livroId) {
    e.stopPropagation();

    const userId = localStorage.getItem('user_id');
    if (!userId) {
      alert('Você precisa estar logado para adicionar ao carrinho.');
      return;
    }

    fetch('http://localhost:5000/carrinho', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'X-User-Id': userId
      },
      body: JSON.stringify({ livro_id: livroId }),
    })
      .then(res => res.json())
      .then(data => alert(data.mensagem || data.erro))
      .catch(() => alert('Erro ao adicionar à estante'));
  }

  return (
    <div className="pagina-inicial">
      <div className="menu-superior">
        <button onClick={() => navigate('/perfil')}>Perfil</button>
        <button onClick={() => navigate('/carrinho')}>Estante</button>
        <button onClick={() => navigate('/cadastro-livro')}>Publicar Livro</button>
      </div>
      <h1>Bem-vindo à Página Inicial!</h1>

      <div className="filtros">
        <input
          type="text"
          placeholder="Buscar por nome"
          value={termoBusca}
          onChange={e => setTermoBusca(e.target.value)}
        />
        <select value={filtroSelecionado} onChange={e => setFiltroSelecionado(e.target.value)}>
          <option value="">Todos os Filtros</option>
          {filtros.map(f => (
            <option key={f.id} value={f.id}>{f.nome}</option>
          ))}
        </select>
      </div>

      <div className="livros">
        {livrosFiltrados.map(livro => (
          <div
            key={livro.id}
            className="livro-card"
            onClick={() => abrirDetalhes(livro.id)}
            role="button"
            tabIndex={0}
            onKeyDown={e => {
              if (e.key === 'Enter') {
                e.preventDefault();
                abrirDetalhes(livro.id);
              }
            }}
          >
            <img
              src={livro.imagem_url || '/img/imagem-nao-disponivel.png'}
              alt={livro.nome}
              className="livro-imagem"
            />
            <div className="livro-info">
              <h3>{livro.nome}</h3>
              <p>R$ {livro.preco.toFixed(2)}</p>
              <button
                className="adicionar-btn"
                onClick={e => adicionarAoCarrinho(e, livro.id)}
              >
                Adicionar à Estante
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default PaginaInicial;
